import React from 'react';
import { Link } from 'react-router-dom';
import './Login.css';

const Register = () => {
  return (
    <div className="login">
      <div className="login__container">
        <form>
          <h5>E-mail</h5>
          <input type="text" />

          <h5>Password</h5>
          <input type="password" />

          <button type="submit" className="login__loginButton">
            Reister
          </button>
        </form>

        <Link to='/login' className="login__registerButton">Already sign in. Log In here </Link>
      </div>
    </div>
  );
};

export default Register;
